import React from "react";
import { Link } from "react-router-dom";
import { Affix } from "antd";
import "./nav.css";

const Nav = () => {
  return (
    <Affix>
      <div className="wrapper">

        <nav>
        <Link to="/" style={{ fontWeight: "bold", color: "black" }}>
          <h1>통과했수</h1>
        </Link>
        </nav>
      </div>
    </Affix>
  );
};

export default Nav;
